const { Icon } = require("../components/atoms/icon/icon");

function Index() {
  return (
    <div>
      <h1> Welcome to Next.js! </h1>
      <Icon img="/menu-icons.svg" alt="menu-bar" link="#"></Icon>
    </div>
  );
}

export default Index;
